function Header() {


    return(
        <header>
            {/* Header */}
            <nav className='header'>
                    <a className="logo" href="/">QuiGuia</a>
                    <ul className="nav-list">
                        <li><a href="/">UFC</a></li>
                        <li><a href="/">Serviços</a></li>
                        <li><a href="/">Quixadá</a></li>
                        <li><a href="/">Sobre nós</a></li>
                    </ul>
            </nav>
            </header>
    )
}

export default Header;
